import collections

import pytest


class Solution(object):
    def maxArea(self, input_heights):
        """
        :type height: List[int]
        :rtype: int
        """
        biggest_area = 0

        for ndx, i in enumerate(input_heights):
            x1 = ndx + 1

            big_height = 0
            len_rem_h = len(input_heights)
            for j_ndx in range(len_rem_h - 1, ndx, -1):
                j = input_heights[j_ndx]
                height = i if i < j else j
                if height > big_height:
                    x2 = j_ndx + 1
                    width = abs(x2 - x1)
                    area = width * height
                    if biggest_area < area:
                        biggest_area = area
                    big_height = height

        return biggest_area



